function showTable() {
    var divTable = document.getElementById("tableDiv");
    var radiorow = document.getElementById("radio");
    divTable.style.display = "block";
    radiorow.style.display = "block"
    var tbody = document.getElementById('tbody');
    // show and hide function of button
    var showbtn = document.getElementById('show');
    var hidebtn = document.getElementById('hide');
    showbtn.disabled = true
    hidebtn.disabled = false

    // map function to add element in the array.
    user.map(function(ele, index) {
        var tr = document.createElement('tr');

        tr.id = 'tr' + (index + 1)

        // for row 1
        var td1 = document.createElement('td');
        var td2 = document.createElement('td');
        var td3 = document.createElement('td');
        var td4 = document.createElement('td');
        var td5 = document.createElement('td');
        var img = document.createElement('img');

        img.src = ele.image
        img.width = 50
        img.height = 50
        td1.appendChild(img)
        td2.innerText = ele.name
        td3.innerText = ele.gender
        td4.innerText = ele.city
        td5.innerText = ele.email

        tr.appendChild(td1);
        tr.appendChild(td2);
        tr.appendChild(td3);
        tr.appendChild(td4);
        tr.appendChild(td5);

        tbody.appendChild(tr);

    });

}

function hideTable() {
    var divTable = document.getElementById("tableDiv");
    var radiorow = document.getElementById("radio");

    divTable.style.display = "none";
    radiorow.style.display = "none";
    var showbtn = document.getElementById('show');
    var hidebtn = document.getElementById('hide');
    // logic to remove the four rows
    var tr1 = document.getElementById('tr1');
    var tr2 = document.getElementById('tr2');
    var tr3 = document.getElementById('tr3');
    var tr4 = document.getElementById('tr4');
    var tr5 = document.getElementById('tr5');

    showbtn.disabled = false
    hidebtn.disabled = true
    tr1.remove();
    tr2.remove();
    tr3.remove();
    tr4.remove();
    tr5.remove();
}

